import React from 'react';

function ScoreSection() {
  return (
    <div className="flex flex-col ml-5 w-[33%] max-md:ml-0 max-md:w-full">
      <div className="justify-center items-center self-stretch px-16 pt-28 pb-20 my-auto w-full text-5xl text-black whitespace-nowrap bg-sky-700 rounded-xl border border-black border-solid max-md:px-5 max-md:mt-10 max-md:text-4xl">
        SCORE
      </div>
    </div>
  );
};

export default ScoreSection;
